<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>Bienvenue dans ce tutoriel consacré à la présentation du processus de conception d'un <b>Système de gestion des dépenses</b> en <b>VBA</b> avec l'utilisation des <b>macros</b> et des <b>UserForm</b> sous <b>Excel</b>.<br><br>L'application sera dotée des fonctionnalités suivantes:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une interface de connexion</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une interface de création de compte</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un système d'administration</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une interface de saisie des dépenses</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une interface de visualisation des statistiques sur les dépenses</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une protection contre l'accès aux programmes VBA</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un manuel d'utilisateur</div>
</div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="connexion-d-un-utilisateur">Connexion d'un utilisateur</a>
</h1>
<div class="Section6"><br>Pour se connecter à l'application :<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous saisissons le nom de l'utilisateur (Username).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous saisissons le mot de passe de l'utilisateur (Password).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous validons la connexion (Log In).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous affichons un message d'erreur en cas d'erreur.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creation-d-un-compte">Création d'un compte</a>
</h1>
<div class="Section6"><br>Pour ouvrir l'interface de création de compte:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur le bouton (Create Account).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous saisissons le mot de passe administrateur (Admin Password).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous validons le mot de passe administrateur (OK).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous affichons un message d'erreur en cas d'erreur.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Pour créer un compte:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous saisissons les informations de l'utilisateur (Username, Email, Phone, Password).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous saisissons les permissions de l'utilisateur (Analysis, Dashboard, System Admin).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous validons la création du compte de l'utilisateur (Create Account).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous enregistrons les informations dans la feuille de calcul (User).</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="systeme-d-administration">Système d'administration</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#systeme-d-administration_modification-d-un-compte">Modification d'un compte</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#systeme-d-administration_parametrage-du-menu-excel">Paramétrage du Menu Excel</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="systeme-d-administration_modification-d-un-compte" href="#systeme-d-administration">Modification d'un compte</a>
</h2><br>Pour ouvrir le système d'administration:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur le bouton (System Admin).</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Pour sélectionner un compte:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous double-cliquons sur la ligne sélectionnée.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Pour mettre à jour le compte de l'utilisateur:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous pouvons modifier le nom de l'utilisateur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous pouvons modifier les coordonnées de l'utilisateur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous pouvons modifier le mot de passe de l'utilisateur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous pouvons modifier les permissions de l'utilisateur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(5) Nous pouvons enregistrer les modifications du compte.</div>
</div><br>Pour supprimer le compte de l'utilisateur:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(6) Nous cliquons sur le bouton (Delete).</div>
</div><br>Pour réinitialiser l'interface d'administration:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(7) Nous cliquons sur le bouton (Clean).</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Pour filtrer la recherche d'un utilisateur:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous saisissons le début du nom de l'utilisateur (Username).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous démarrons la recherche de l'utilisateur (Search).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous double-cliquons sur un utilisateur pour le sélectionner.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="systeme-d-administration_parametrage-du-menu-excel" href="#systeme-d-administration">Paramétrage du Menu Excel</a>
</h2><br>Pour afficher les paramètres:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur le bouton (Paramètres).</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Pour afficher le Menu Excel:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur le bouton (Show Menu Excel).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous pouvons accéder au ruban Excel.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous pouvons accéder à la barre de formule Excel.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Nous pouvons accéder aux en-têtes de colonnes.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(5) Nous pouvons accéder aux en-têtes de lignes.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(6) Nous pouvons accéder aux onglets des feuilles de calcul.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(7) Nous pouvons accéder à l'interface de l'application.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Pour masquer le Menu Excel:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur le bouton (Hide Menu Excel).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous pouvons accéder uniquement à l'interface de l'application.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="structure-du-projet-vba">Structure du projet VBA</a>
</h1>
<div class="Section6"><br>Définition de la structure d'un projet VBA:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Les feuilles de calcul Excel (Worksheet)</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) L'application Excel (Workbook)</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Les interfaces graphiques (UserForm)</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(4) Les modules de fonctions (Module)</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(5) Le point d'entrée du projet VBA (Workbook_Open)</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(6) Le nom du programme VBA (rdv_workbook)</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="protection-du-projet-vba">Protection du projet VBA</a>
</h1>
<div class="Section6"><br>Pour accéder au projet VBA:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(1) Nous cliquons sur le projet VBA.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(2) Nous saisissons le mot de passe du projet VBA.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">(3) Nous validons le mot de passe du projet VBA.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
